export const Task = (task,{onClick}) => {
    // console.log(props)
    return(<>
    
        <div className="taskItem">
            <h4>{task.taskname}</h4>
            <h4>Due: {task.date}</h4>
            <button onClick={onClick}>Edit</button>
            <button>Delete</button>
        </div>
    </>)
}
